import {  useContext } from "react"
import { prodact1 } from "./prodactDetils"
function ProdactList(){
    const prodact=useContext(prodact1)
    return(

        <div>
            {prodact.map((prodact)=> <h1 key={prodact.id}>{prodact.titel }</h1>
              

            )}
        </div>
    )
}
export default ProdactList
